import React from 'react';
import  ReactDOM  from 'react-dom';

const name = "Musaif";
const img = "https://picsum.photos/900/600";
ReactDOM.render(
<>
<h2>Hello world my name is {name}</h2>
<img src={img} alt="Random/img" />
<img src={img} alt="Random/img" />
<img src={img} alt="Random/img" />
<img src={img} alt="Random/img" />
</>, document.getElementById("root")
);
